// src/components/About.jsx
import { Container, Typography, Grid, Card, CardContent, Box } from "@mui/material";
import { motion } from "framer-motion";

const aboutData = [
  {
    title: "Expert Care",
    desc: "We provide world-class physiotherapy treatments with experienced professionals.",
    img: "https://images.unsplash.com/photo-1580281657521-6c5d3c1b9c92?auto=format&fit=crop&w=800&q=80"
  },
  {
    title: "Modern Clinics",
    desc: "State-of-the-art equipment and comfortable environments for faster recovery.",
    img: "https://images.unsplash.com/photo-1606813902919-9f0c3a67c8fa?auto=format&fit=crop&w=800&q=80"
  },
  {
    title: "Personalized Treatment",
    desc: "Customized therapy plans designed for each patient’s unique condition.",
    img: "https://images.unsplash.com/photo-1579154204601-01588f351e67?auto=format&fit=crop&w=800&q=80"
  }
];

export default function About() {
  return (
    <Box sx={{ bgcolor: "#f5f7fa", py: 8 }}>
      <Container>

        {/* Heading */}
        <motion.div
          initial={{ opacity: 0, y: -40 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography variant="h3" textAlign="center" gutterBottom fontWeight="bold">
            About PhysioTattva
          </Typography>
          <Typography variant="h6" textAlign="center" sx={{ mb: 5, color: "gray" }}>
            Healing through science, care and movement
          </Typography>
        </motion.div>

        {/* Top Image + Text */}
        <Grid container spacing={4} alignItems="center" sx={{ mb: 6 }}>
          <Grid item xs={12} md={6}>
            <motion.img
              src="https://images.unsplash.com/photo-1550831107-1553da8c8464?auto=format&fit=crop&w=900&q=80"
              alt="Physiotherapy"
              style={{ width: "100%", borderRadius: "16px" }}
              initial={{ opacity: 0, x: -50 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 1 }}
            />
          </Grid>

          <Grid item xs={12} md={6}>
            <motion.div
              initial={{ opacity: 0, x: 50 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 1 }}
            >
              <Typography variant="h5" fontWeight="bold" gutterBottom>
                Who We Are
              </Typography>
              <Typography>
                PhysioTattva is a leading physiotherapy and rehabilitation center providing
                evidence-based treatments with advanced technology. Our goal is to restore
                movement, reduce pain, and improve quality of life through personalized care.
              </Typography>
            </motion.div>
          </Grid>
        </Grid>

        {/* Cards Section */}
        <Grid container spacing={4}>
          {aboutData.map((item, index) => (
            <Grid item xs={12} md={4} key={index}>
              <motion.div
                initial={{ opacity: 0, y: 40 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.2 }}
              >
                <Card sx={{ borderRadius: 4, height: "100%" }}>
                  <Box
                    component="img"
                    src={item.img}
                    alt={item.title}
                    sx={{ width: "100%", height: 200, objectFit: "cover" }}
                  />
                  <CardContent>
                    <Typography variant="h6" fontWeight="bold" gutterBottom>
                      {item.title}
                    </Typography>
                    <Typography>{item.desc}</Typography>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>

        {/* Mission & Vision */}
        <Grid container spacing={4} sx={{ mt: 6 }}>
          <Grid item xs={12} md={6}>
            <motion.div
              initial={{ opacity: 0, y: 40 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
            >
              <Typography variant="h5" fontWeight="bold" gutterBottom>
                Our Mission
              </Typography>
              <Typography>
                To deliver compassionate, innovative and result-driven physiotherapy services
                that help people regain strength, mobility and confidence.
              </Typography>
            </motion.div>
          </Grid>

          <Grid item xs={12} md={6}>
            <motion.div
              initial={{ opacity: 0, y: 40 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
            >
              <Typography variant="h5" fontWeight="bold" gutterBottom>
                Our Vision
              </Typography>
              <Typography>
                To be the most trusted physiotherapy and rehabilitation brand delivering world-class
                patient outcomes through research and technology.
              </Typography>
            </motion.div>
          </Grid>
        </Grid>

      </Container>
    </Box>
  );
}
